F# has a pretty good interoperability with Javascript when using the Fable library. When building user interfaces using React, there are multiple alternatives, but the necessary resources to build solutions using Fable seem scattered around the internet. This document aims to provide a solid getting started to both Fable and Feliz, and how to use both in order to interoperate F# with an existing React library. Fable is a library that allows one to write F# code while using existing web solutions in the Javascript ecossystem. It also allows one to export libraries that can be called from Javascript code. As seen in " Call JS from Fable ", there are multiple ways of importing generic JS objects into our project, this document will use ImportAttribute to import objects. Note that by default, we don't have any types when importing and giving data to JS objects, but we can easily add types on the F# side to have a type-safe experience when developing with Fable, for example: // File.ts interface MyInterface { name: string lastName: string
} let myObject: MyInterface = {name: "john", lastName: "bar"} export const myObject; // my-file.fs type Interface = { name: string lastName: string
} [<Import("default", from="./my-file.js")>]
