Feliz is a library used to directly interface React, adding the ability to create new type-safe components directly by using F# or using already existing components defined in other languages. We can define new React components in F# using the ReactComponent attribute, for example: /// <summary>
/// A stateful React component that maintains a counter
/// </summary>
[<ReactComponent>]
static member Counter() = let (count, setCount) = React.useState(0) Html.div [ Html.h1 count Html.button [ prop.onClick (fun _ -> setCount(count + 1)) prop.text "Increment" ] ] In order to import existing components from other libraries, we also use <ReactComponent>: [<ReactComponent(import="default", from="react-markdown")>]
static member Markdown(children: string, remarkPlugins: obj seq) = React.imported() Note that in this case, we pass import="default" since it is a default export, when dealing with named exports, import should receive the name of the exported value.

