While tinkering with and learning more about VFIO and QEMU/libvirt, I've managed to find an interesting virtual machine workflow: Audio: Scream + Bridged Network. Video: I'm using both the native GPU's output and Looking Glass, depending on what I'm doing. Inputs: I'm using both my keyboard and mouse as evdev inputs, so I can swap between the bare metal and the virtual machine. I'm also using KMonad's output device as my keyboard device. Storage: I've installed Windows in a small QEMU virtual disk inside my SSD for faster initialization and added another QEMU virtual storage (which is inside my HD) for storing data. The experience has been much greater than dual boot, since I can just open Looking Glass and use Windows as if it were just another workspace in my window manager. Now I can use both the OSses at the same time and don't need to waste time waiting for system reboots. I hope this post to be useful for whoever want to try a virtual machine + GPU passthrough workflow, be it another reader or myself trying to setup it again after formatting the computer. This is how my final NixOS configuration looks like: { pkgs, ... }: let username = "vini";
in
{ boot = { kernelParams = [ # https://wiki.archlinux.org/title/PCI_passthrough_via_OVMF#Setting_up_IOMMU "intel_iommu=on" "iommu=pt" "pcie_aspm=off" ]; kernelModules = [ "kvm-intel" "vfio_pci" "vfio_iommu_type1" "vfio_virqfd" "vfio" ]; blacklistedKernelModules = [ "nvidia" "nouveau" ]; extraModprobeConfig = "options vfio-pci ids=10de:1b81"; postBootCommands = '' DEVS="0000:0f:00.0 0000:0f:00.1" for DEV in $DEVS; do echo "vfio-pci" > /sys/bus/pci/devices/$DEV/driver_override done modprobe -i vfio-pci ''; }; services.udev.extraRules = '' # Symlink KMonad device ACTION=="add", ATTRS{name}=="KMonad output", SYMLINK+="KMONAD_DEVICE" ''; services.pipewire = { enable = true; pulse.enable = true; }; systemd.tmpfiles.rules = [ "f /dev/shm/looking-glass 0660 ${username} qemu-libvirtd -" ]; systemd.user.services.scream-network = { enable = true; description = "Scream network"; serviceConfig = { ExecStart = "${pkgs.scream}/bin/scream -o pulse -i virbr0"; Restart = "always"; }; wantedBy = [ "default.target" ]; requires = [ "pipewire.service" ]; }; virtualisation.libvirtd = { enable = true; onBoot = "ignore"; onShutdown = "shutdown"; qemu = { ovmf.enable = true; runAsRoot = false; }; }; environment.systemPackages = with pkgs; [ virt-manager looking-glass-client ];
}

